import React from 'react';
import { NavLink } from 'react-router-dom';
import { Navbar, Nav, Container, Button } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

const MyNavbar = (props) => {
    return (
        <>
            <Navbar bg="primary" data-bs-theme="dark">
            <Container>
                    <Navbar.Brand as={NavLink} to="/">
                        Navbar
                    </Navbar.Brand>
                    <Nav className="me-auto">
                        <Nav.Link as={NavLink} to="/home">Home</Nav.Link>
                        <Nav.Link as={NavLink} to="/something">Something</Nav.Link>
                        <Nav.Link as={NavLink} to="/somethingElse">Something Else</Nav.Link>
                    </Nav>
                    <Nav>
                        <Button as={NavLink} to="/login" variant="outline-light" className="me-2">Login</Button>
                        <Button as={NavLink} to="/signin" variant="outline-light">Sign In</Button>
                    </Nav>
                </Container>
            </Navbar>
        </>
    );
}

          
export default MyNavbar;
          






